function calculateCanvasSize(pageWidth, pageHeight, padding) {
    const availableWidth = pageWidth - 2 * padding;
    const availableHeight = pageHeight - 2 * padding;

    const aspectRatio = 16 / 9;

    let canvasWidth = availableWidth;
    let canvasHeight = availableWidth / aspectRatio;

    if (canvasHeight > availableHeight) {
        canvasHeight = availableHeight;
        canvasWidth = availableHeight * aspectRatio;
    }

    return {
        width: canvasWidth,
        height: canvasHeight
    };
}

function resizeCanvas() {
    const pageWidth = window.innerWidth;
    const pageHeight = window.innerHeight;

    const padding = 50;

    const { width, height } = calculateCanvasSize(pageWidth, pageHeight, padding);

    const canvas = document.getElementById('canvas');
    canvas.width = width;
    canvas.height = height;

    const canvasContainer = document.getElementById('canvasContainer');
    canvasContainer.style.display = 'flex';
    canvasContainer.style.justifyContent = 'center';
    canvasContainer.style.alignItems = 'center';
    canvasContainer.style.height = `${pageHeight}px`;
}

targetX = 700
targetY = 350

function drawImage(img, originX, originY, minY, maxY) {
    const canvas = document.getElementById('canvas');
    const ctx = canvas.getContext('2d');

    const imgWidth = img.width;
    const imgHeight = img.height;

    const scaleY = (maxY - minY) / canvas.height;
    const scaledWidth = imgWidth * scaleY;
    const scaledHeight = imgHeight * scaleY;

    const drawX = targetX - (originX * scaleY);
    const drawY = targetY - (originY * scaleY);

    ctx.globalAlpha = 0.75;
    ctx.drawImage(img, drawX, drawY, scaledWidth, scaledHeight);
};

